
import React from 'react';
import { PROFILE } from '../constants';
import { LinkedInIcon, GithubIcon, MailIcon } from './Icons';

const Hero: React.FC = () => {
  const handleScrollToContact = (e: React.MouseEvent<HTMLAnchorElement, MouseEvent>) => {
    e.preventDefault();
    document.querySelector('#contact')?.scrollIntoView({ behavior: 'smooth' });
  };
    
  return (
    <section id="hero" className="min-h-screen flex items-center bg-cover bg-center" style={{ backgroundImage: "url('data:image/jpeg;base64,')" }}>
       <div className="absolute inset-0 bg-light-bg dark:bg-dark-bg opacity-70"></div>
      <div className="container mx-auto px-6 text-center relative z-10">
        <h1 className="text-4xl md:text-6xl font-extrabold text-light-text dark:text-dark-text leading-tight mb-4">
          {PROFILE.name}
        </h1>
        <h2 className="text-2xl md:text-3xl font-semibold text-primary dark:text-accent mb-6">
          {PROFILE.title}
        </h2>
        <p className="max-w-3xl mx-auto text-lg md:text-xl text-light-text dark:text-gray-300 mb-8">
          {PROFILE.tagline}
        </p>
        <div className="flex justify-center items-center space-x-6 mb-8">
          <a href={PROFILE.linkedin} target="_blank" rel="noopener noreferrer" className="text-light-text dark:text-gray-300 hover:text-primary dark:hover:text-accent transition-transform transform hover:scale-110">
            <LinkedInIcon className="w-8 h-8" />
          </a>
          <a href={PROFILE.github} target="_blank" rel="noopener noreferrer" className="text-light-text dark:text-gray-300 hover:text-primary dark:hover:text-accent transition-transform transform hover:scale-110">
            <GithubIcon className="w-8 h-8" />
          </a>
          <a href={`mailto:${PROFILE.email}`} className="text-light-text dark:text-gray-300 hover:text-primary dark:hover:text-accent transition-transform transform hover:scale-110">
            <MailIcon className="w-8 h-8" />
          </a>
        </div>
        <a 
          href="#contact" 
          onClick={handleScrollToContact}
          className="bg-primary hover:bg-secondary text-white font-bold py-3 px-8 rounded-full transition-all duration-300 shadow-lg hover:shadow-xl transform hover:-translate-y-1"
        >
          Get In Touch
        </a>
      </div>
    </section>
  );
};

export default Hero;
